import sys, os, mmap

def Main():
  print("Battlefleet Gothic: Armada Saved Game Editor v1.9 by Cryptomancer\n")

  while True:
    print("1: Edit Campaign Save")
    print("2: Edit Solo Skirmish Profile")
    print("3: Exit")
    EditMode = input("\nSelect Mode: "); print("")

    if (EditMode == "1"):
      BGAEdit(os.path.join(os.path.expandvars("%LOCALAPPDATA%"),"BattleFleetGothic\Saved\SaveGames\Campaign"),1)
    elif (EditMode == "2"):
      BGAEdit(os.path.join(os.path.expandvars("%LOCALAPPDATA%"),"BattleFleetGothic\Saved\SaveGames\Profile"),0)
    elif (EditMode == "3"):
      sys.exit()
    else:
      print("Invalid Selection - Try Again\n")
      continue

def BGAEdit(BGAProfilePath,isCampaign):
  FileList = os.listdir(BGAProfilePath)
  ProfileList = []
  
  for File in FileList: #Only include valid saved games
    if (File.find("Meta") == -1 and File.find("CrossCampaign") == -1):
      ProfileList.append(File)
  
  while True: #Saved game selection input loop
    ProfileCounter = 1
    for Profile in ProfileList: #Display list of games
      print(ProfileCounter,": ",ProfileList[ProfileCounter-1].replace('.sav',''),sep='')
      ProfileCounter += 1
    
    EditProfile = int(input("\nSelect Profile: ")); print("")
    if (EditProfile < 1 or EditProfile >= ProfileCounter):
      print("Invalid Selection - Try Again\n")
      continue
    else:
      break
    
  with open(os.path.join(BGAProfilePath,ProfileList[EditProfile-1]),"rb+") as Profile:
    ProfileMM = mmap.mmap(Profile.fileno(), 0)
 
  while True: #Edit mode input loop
    print("1: Edit Admiral")
    print("2: Edit Ships")
    print("3: Go Back")
    EditMode = input("\nSelect Mode: "); print("")
    
    if (EditMode == "1"):
      EditAdmiral(ProfileMM,ProfileList[EditProfile-1].replace('.sav',''),isCampaign)
      continue
    elif (EditMode == "2"):
      EditShips(ProfileMM)
      continue
    if (EditMode == "3"):
      return
    else:
      print("Invalid Selection - Try Again\n")
      continue
  return

def EditAdmiral(ProfileMM, AdmiralName, isCampaign):
  while True: #Admiral property edit input loop
    ProfileMM.seek(0)
    if (isCampaign == 1):
      ProfileMM.seek(ProfileMM.find(b'\x50\x72\x6F\x66\x69\x6C\x65\x53\x61\x76\x65'))  #ProfileSave

    ProfileMM.seek(ProfileMM.find(b'\x45\x6E\x75\x6D\x46\x61\x63\x74\x69\x6F\x6E\x00')+12) #EnumFaction
    StrLength = int.from_bytes(ProfileMM.read(4),sys.byteorder)
    ProfileMM.seek(13,os.SEEK_CUR)
    AdmiralFaction = ProfileMM.read(StrLength-14).decode("utf-8")
    if (isCampaign == 1):
      ProfileMM.seek(ProfileMM.find(b'\x4E\x61\x6D\x65\x00')+30)  #Name
      StrLength = int.from_bytes(ProfileMM.read(4),sys.byteorder)
      AdmiralName = ProfileMM.read(StrLength-1).decode("utf-8")
    ProfileMM.seek(ProfileMM.find(b'\x4C\x65\x76\x65\x6C\x00\x0C')+30)  #Level
    AdmiralLevel = ProfileMM.read_byte()
    ProfileMM.seek(ProfileMM.find(b'\x52\x65\x6E\x6F\x77\x6E\x65\x64\x50\x6F\x69\x6E\x74\x73')+39)  #RenownedPoints
    AdmiralRenown = int.from_bytes(ProfileMM.read(4),sys.byteorder)
    AdmiralEliteLevel = ProfileMM.find(b'\x45\x6C\x69\x74\x65\x4C\x65\x76\x65\x6C')  #EliteLevel
    if (AdmiralEliteLevel == -1): #If no Elite rank battles have been fought then this field will not exist
      AdmiralEliteLevel = b'\x0B\x00\x00\x00\x45\x6C\x69\x74\x65\x4C\x65\x76\x65\x6C\x00\x0C\x00\x00\x00\x49\x6E\x74\x50\x72\x6F\x70\x65\x72\x74\x79\x00\x04\x00\x00\x00\x00\x00\x00\x00\x00\x00\x00\x00'
      InsertIntoMM(ProfileMM,AdmiralEliteLevel,ProfileMM.tell())
      AdmiralEliteLevel = 0
    else:
      ProfileMM.seek(AdmiralEliteLevel+35)
      AdmiralEliteLevel = int.from_bytes(ProfileMM.read(4),sys.byteorder)
    AdmiralDifficulty = ProfileMM.find(b'\x45\x6E\x75\x6D\x44\x69\x66\x66\x69\x63\x75\x6C\x74\x79') #EnumDifficulty
    if (AdmiralDifficulty == -1): #If difficulty is EASY there is no EnumDifficulty field so this will fail
      AdmiralDifficulty = "EASY"
    else:
      ProfileMM.seek(AdmiralDifficulty+15)
      StrLength = int.from_bytes(ProfileMM.read(4),sys.byteorder)
      ProfileMM.seek(16, os.SEEK_CUR)
      AdmiralDifficulty = ProfileMM.read(StrLength-17).decode("utf-8")
      ProfileMM.seek(0)
    if (isCampaign == 1):
      ProfileMM.seek(ProfileMM.find(b'\x44\x65\x70\x6C\x6F\x79\x6D\x65\x6E\x74\x41\x6C\x6C\x6F\x77\x65\x64')+53)  #DeploymentAllowed
      AdmiralDeployments = ProfileMM.read_byte()
    if (AdmiralFaction == "SPACE_MARINE"):
      SpaceMarineChapterValues = {1:"IMPERIAL FISTS", 2:"DARK ANGELS", 3:"SPACE WOLVES", 4:"BLOOD ANGELS"}
      SpaceMarineChapter = ProfileMM.find(b'\x53\x75\x62\x46\x61\x63\x74\x69\x6F\x6E\x49\x6E\x64\x65\x78')  #SubFactionIndex
      if (SpaceMarineChapter == -1):
        SpaceMarineChapter = "ULTRAMARINES"  #Rather than making the SubFactionIndex 0 and be consistent, Ultramarines lack the field entirely
      else:
        ProfileMM.seek(SpaceMarineChapter+40)
        SpaceMarineChapter = int.from_bytes(ProfileMM.read(4),sys.byteorder)
        SpaceMarineChapter = SpaceMarineChapterValues[SpaceMarineChapter]
    
    #If the Admiral has never fought a battle, there will be no XPTotal field at all.
