def ResolveMissions(ProfileMM):
  FactionImperium = b'\x16\x00\x00\x00\x45\x6E\x75\x6D\x46\x61\x63\x74\x69\x6F\x6E\x3A\x3A\x49\x4D\x50\x45\x52\x49\x55\x4D\x00' #EnumFaction::IMPERIUM
  ProfileMM.seek(0)
  while True:
    MissionStart = ProfileMM.find(b'\x48\x61\x73\x43\x61\x6D\x70\x61\x69\x67\x6E\x45\x76\x65\x6E\x74')  #HasCampaignEvent
    ProfileMM.seek(ProfileMM.find(b'\x49\x73\x4D\x61\x6E\x64\x61\x74\x6F\x72\x79',MissionStart)+37) #IsMandatory
    IsMandatory = ProfileMM.read_byte() #Indicates if this is a priority mission
    ProfileMM.seek(MissionStart+42)
    IsMission = ProfileMM.read_byte()
    if (MissionStart != -1 and IsMission == 1 and IsMandatory == 0):
      ProfileMM.seek(-1,os.SEEK_CUR)
      ProfileMM.write_byte(0) #Remove the active mission
      FactionStart = ProfileMM.rfind(b'\x45\x6E\x75\x6D\x46\x61\x63\x74\x69\x6F\x6E\x00',0,MissionStart)+12  #EnumFaction
      ProfileMM.seek(FactionStart)
      MissionFaction = ProfileMM.read(len(FactionImperium))
      FactionLength = MissionFaction[0]+4
      if (MissionFaction != FactionImperium): #Set world control to IMPERIUM
        DeleteFromMM(ProfileMM,FactionStart,FactionStart+FactionLength)
        InsertIntoMM(ProfileMM,FactionImperium,FactionStart)
    elif (MissionStart == -1):
      break
      
  while True:
    Threat = ProfileMM.find(b'\x54\x68\x72\x65\x61\x74')  #Threat
    if (Threat != -1):
      ProfileMM.seek(Threat+31)
      ProfileMM.write_byte(0) #Set Threat to 0
      ProfileMM.seek(ProfileMM.tell()+48)
      ProfileMM.write_byte(0) #Set NbWorldPossessed to 0
    else:
      break
  return

